import React from 'react';
import styled from "@emotion/styled";

const Cotizacion = ({resultado}) => {
    if(Object.keys(resultado).length === 0) return null;
    console.log(resultado)

    return (
       <ResultadoDiv>
            <Logo src={	`https://www.cryptocompare.com/${resultado.IMAGEURL}`}></Logo>
            <Precio><span>{resultado.PRICE}</span> </Precio>
            <Info>Daily max: <span>{resultado.HIGHDAY}</span>Daily min: <span>{resultado.LOWDAY}</span> </Info>
            <Info>24 hs: <span>{resultado.CHANGEPCT24HOUR}%</span> </Info>
            <Info>Last Update: <span>{resultado.LASTUPDATE}</span> </Info>
       </ResultadoDiv>
    );
}

export default Cotizacion

const ResultadoDiv = styled.div`
    background-color: white;
    color: black;
    border-radius: 9px;
    font-family: Arial, Helvetica, sans-serif;
    margin-top:24px ;
    padding: 6px 6px 3px 18px;
`;

const Info = styled.p`
    font-size: 20px;

    span {
        font-weight:bold;
    }
`;
const Precio = styled.p`
    font-size: 20px;
    color: black;
    span {
        font-weight:bold;
    }
`

const Logo = styled.img`
    max-height: 40px;
`
